import logo from './logo.svg';
import './App.css';
import {useEffect, useState} from "react";
import Axios from "axios";
import axios from "axios";


function App() {
    const [message, setMessage] = useState("");
    useEffect(()=> {
        axios.get("/home")
            .then((res)=>{
                console.log("Hello")
                console.log(res);
                console.log(res.data);
                setMessage(res.data);
            })
            .catch(e => {
                alert("error")
            })
    },[]);


    return (
            <div className="container">

                <div className="jumbotron">
                    <h1>HELLO SHOP</h1>
                    <p className="lead">회원 기능</p>
                    <p>
                        <a className="btn btn-lg btn-secondary" href="/members/new">회원 가입</a>
                        <a className="btn btn-lg btn-secondary" href="/members">회원 목록</a>
                    </p>
                    <p className="lead">상품 기능</p>
                    <p>
                        <a className="btn btn-lg btn-dark" href="/items/new">상품 등록</a>
                        <a className="btn btn-lg btn-dark" href="/items">상품 목록</a>
                    </p>
                    <p className="lead">주문 기능</p>
                    <p>
                        <a className="btn btn-lg btn-info" href="/order">상품 주문</a>
                        <a className="btn btn-lg btn-info" href="/orders">주문 내역</a>
                    </p>
                </div>
            </div>
    );
}

export default App;
